records.addlTxt:
Defendant Dayna D Snow in court with attorney Thomas K. Hackbart.  Ann R. Lopez appeared for the State of Wisconsin.  Deputy Court Clerk ssm.  

Defendant changes his plea to GUILTY.  Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty.   Defendant advised that if not a United States Citizen, deportation is possible.  Court found that defendant knowingly, voluntarily and intelligently waived his rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  

Sentencing proceeded.  Statements by the State, defense and defendant.  Defendant sentenced to serve 6 MONTHS in the House of Correction.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 1 YEAR.
Conditions: 
*  AODA  assessement/treatment deemed appropriate;
*  Possess no controlled substances or prescribed medications unless prescribed for the defendant;
*  Possess no firearms;
*  Pay all costs and surcharges or, if not paid, convert to a civil judgment;
*  Submit a DNA sample and pay the DNA surcharge or, if not paid, convert to a civil judgment.
Upon successful completion of probation and no new violations of the law, Court will grant expungement.  Notice of Right to Seek Postconviction Relief received and filed.

OFF THE RECORD:  Defendant was given credit for 27 days of pretrial incarceration.
